import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Try to find the "Your Profile" link using multiple selector strategies
    // 1. By text (first visible occurrence)
    const profileLink = await page.waitForSelector('a:text("Your Profile")', { timeout: 5000 });

    // Highlight the link for screenshot
    await page.evaluate(el => el.style.outline = '3px solid red', profileLink);

    // Take screenshot before clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_link_found.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_link_found.png'));

    // Click the "Your Profile" link
    await profileLink.click();

    // Wait for Jun's profile page to load (look for Jun's full name or username)
    // We'll wait for the profile header with Jun's name
    const junNameSelector = 'h2:text("Jun Kim"), .profile-info h2:text("Jun Kim")';
    await page.waitForSelector(junNameSelector, { timeout: 5000 });

    // Take screenshot of Jun's profile
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_jun_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_jun_profile.png'));

    // Extract Jun's profile data for verification
    const extractedData = await page.evaluate(() => {
      const name = document.querySelector('.profile-info h2')?.innerText || '';
      const username = document.querySelector('.profile-info .username')?.innerText || '';
      const bio = document.querySelector('.profile-info .bio')?.innerText || '';
      return { name, username, bio };
    });

    return {
      success: true,
      action: "Navigated to Jun's Profile and verified profile information",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
